import React from 'react';
import { withRouter, Link } from 'react-router-dom';

const Header = (props) => {
    return (
      <React.Fragment>
        <div className="container-fluid">
          <div className="row">
            <div className="border" style={{height:'70px', width:'100%'}}></div>
          </div>
        </div>
      </React.Fragment>
    )
}

export default (withRouter(Header));
